import React from "react";
import PropTypes from "prop-types";
import { Button as BaseButton } from "antd";

import "./Button.sass";

const Button = ({ props }) => {
  return <BaseButton className="button" {...props} />;
};

Button.PropTypes = {
  className: PropTypes.string
};

export default Button;
